import React from 'react';
import readData from './readData';
const product_data = require('./products.json');
class App extends React.Component
{
  readData(jsonData)
  {
    var ret="";
    for(let data in jsonData)
    {
      if(typeof(jsonData[data])=="object")
        readData(jsonData[data]);
      if(typeof(jsonData[data])!="object" && data!="Brand")
        return ( 
          ret = <div>{data} : {jsonData[data]}</div>
        );
    }
    return ret;
  }
  render() {
    return (
      <div className="App">
        <header id="hroot">Header</header>
        <div id="croot">
          <div class="topnav">
            <a class="active" href="#home">Home</a>
            <a href="#news">News</a>
            <a href="#contact">Contact</a>
            <a href="#about">About</a>
          </div>
          <div class="content">
            {this.readData(this.product_data)}
          </div>
        </div>
        <footer id="froot">Footer</footer>
      </div>
    );
  }
}
export default App;
